import React from 'react';
import Bg from './Images/intro-bg.jpg';
import Navbar from './navbar';
const header = () => {
  return (
    <div>
      <header>
        <img src={Bg} alt="bg" />
        <div className="overlay"></div>
        <Navbar></Navbar>
      </header>
    </div>
  );
};

export default header;
